class Golorp():
    def __init__(self, name):
        self.name = name
        self.jaws = []
        self.stomach = []
        self.preprocess()
        self.variables = {
            'a': None,
            'b': None,
            'c': None,
            'd': None,
            'e': None,
            'f': None,
            'g': None,
            'h': None,
            'i': None,
            'j': None,
            'k': None,
            'l': None,
            'm': None,
            'n': None,
            'o': None,
            'p': None,
            'q': None,
            'r': None,
            's': None,
            't': None,
            'u': None,
            'v': None,
            'w': None,
            'x': None,
            'y': None,
            'z': None
        }

    def preprocess(self):
        self.jaws = self.name[:self.name.find(':')].split('(')[1].split(')')[0].split('/')
        self.stomach = self.name[self.name.find(':') + 1:].split(',')

    def feed(self, sequence):
        for i in range(len(sequence)):
            for jaw in self.jaws:
                for j in range(len(jaw)):
                    if jaw[j] == '_':
                        jaw[j] = sequence[i]
                        break
        for jaw in self.jaws:
            if '_' in jaw:
                return False
        for jaw in self.jaws:
            if jaw[0] == '-':
                jaw = jaw[1:]
            elif jaw[-1] == '-':
                jaw = jaw[:-1]
            if jaw[0] == '+':
                jaw = jaw[1:]
            elif jaw[-1] == '+':
                jaw = jaw[:-1]
            if jaw[0] == '*':
                jaw = jaw[1:]
            elif jaw[-1] == '*':
                jaw = jaw[:-1]
            for i in range(1, len(jaw)):
                if jaw[i] == '+':
                    jaw[i - 1] += jaw[i + 1]
                    jaw[i + 1] = None
                elif jaw[i] == '-':
                    jaw[i - 1] -= jaw[i + 1]
                    jaw[i + 1] = None
                elif jaw[i] == '*':
                    jaw[i - 1] *= jaw[i + 1]
                    jaw[i + 1] = None
            while None in jaw: jaw.remove(None)
            self.variables[jaw[0]] = int(jaw[1])

        for stomach in self.stomach:
            for char in stomach:
                if self.variables[char] is None:
                    return False

            if stomach[0] == '<':
                if self.variables[stomach[1]] >= self.variables[stomach[2]]:
                    return False
            elif stomach[0] == '>':
                if self.variables[stomach[1]] <= self.variables[stomach[2]]:
                    return False
            else:
                if self.variables[stomach[0]] != self.variables[stomach[1]]:
                    return False

        return True

    def find_solution(self):

        def generate_sequences(l, n):
            if l == 0:
                return [[]]
            else:
                return [[x] + y for x in range(n) for y in generate_sequences(l - 1, n)]
        for sequence in generate_sequences(len(self.jaws), 10):
            if self.feed(sequence):
                return sequence

        return False



